import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { Subject } from 'rxjs';
import { map } from 'rxjs/operators';
import { Router } from '@angular/router';
import { jsPDF } from "jspdf";

@Injectable({providedIn: 'root'})
export class addFonts {

  addArialFonts() {

    var font = '';
    var callAddFont = function () {
      this.addFileToVFS('ARIALNB-bold.ttf', font);
      this.addFont('ARIALNB-bold.ttf', 'ARIALNB', 'bold');
    };
    jsPDF.API.events.push(['addFonts', callAddFont])

    var font = '';
    var callAddFont = function () {
      this.addFileToVFS('arialbd-bold.ttf', font);
      this.addFont('arialbd-bold.ttf', 'arialbd', 'bold');
    };
    jsPDF.API.events.push(['addFonts', callAddFont])

    var font = '';
    var callAddFont = function () {
      this.addFileToVFS('ARIALN-bold.ttf', font);
      this.addFont('ARIALN-bold.ttf', 'ARIALN', 'normal');
    };
    jsPDF.API.events.push(['addFonts', callAddFont])

    var font = '';
    var callAddFont = function () {
      this.addFileToVFS('ariblk-bold.ttf', font);
      this.addFont('ariblk-bold.ttf', 'ariblk', 'bold');
    };
    jsPDF.API.events.push(['addFonts', callAddFont])


    }
}
